import { useContext } from "react"
import { dataContext } from "../ReactProject"

function GalleryCom() {
    const context=useContext(dataContext)
     const {title}= context.dataContext
    return<div>
       <h2>{title}</h2>
       {
        context.gallery.galleryData.map((item,i)=>{
              return<div key={i}>
                <img src={item.imgUrl}/>
                <div>
                    <h3>{item.details}</h3>
                </div>
              </div>
        })
       }
    </div>
}
export default GalleryCom
